SELECT [DDS_Lookup Monday to Sunday].[Week Ending Sunday], [DDS Hispanic TV by Network tbl].NETWORK, [DDS Hispanic TV by Network tbl].[ACT WM3564 GRP], [DDS Hispanic TV by Network tbl].[ACT WM2554 GRP], [DDS Hispanic TV by Network tbl].[ACT HOMES GRP], [DDS Hispanic TV by Network tbl].Spend, [DDS Hispanic TV by Network tbl].Prd FROM [DDS_Lookup Monday to Sunday] LEFT JOIN [DDS Hispanic TV by Network tbl] ON [DDS_Lookup Monday to Sunday].[Week Starting Monday] = [DDS Hispanic TV by Network tbl].[Week Starting Monday];
